import React from 'react';
import './App.css';
import img from './assets/img/img4.jpg'
import {
  useNavigate
} from "react-router-dom";

const App = () => {

  const navigate = useNavigate();
  const orderFn = () => {
    navigate("../success", { replace: true });


  }

  return (
    <div className='App'>
      <div className='container'>
        <img
          src={img}
          width="500" height="600"
        />

      </div>
      <div className='container'>
        <button onClick={orderFn()} type="button" class="btn btn-success">Order Now</button>
      </div>
    </div>
  );

}

export default App;
